import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/navbar';
import PostList from './components/postList';
import EditPost from './components/postEdit'; // Ensure the case matches the file name
import CreatePost from './components/postCreate'; // Ensure the case matches the file name
import Register from './components/register'; // Ensure the case matches the file name
import Login from './components/login'; // Ensure the case matches the file name
import { AuthProvider } from './AuthContext'; // Import the AuthProvider

import './App.css';

const App = () => {
    return (
        <AuthProvider>
            <Router>
                <div className="App">
                    <Navbar />
                    <Routes>
                        <Route exact path="/" element={<PostList />} />
                        <Route exact path="/postEdit/:id" element={<EditPost />} />
                        <Route exact path="/create" element={<CreatePost />} />
                        <Route exact path="/register" element={<Register />} />
                        <Route exact path="/login" element={<Login />} />
                    </Routes>
                </div>
            </Router>
        </AuthProvider>
    );
}

export default App;
